INSERT INTO `field_data_body` VALUES ('node', 'article', '0', '1', '1', 'und', '0', '<h1>\r\n	<img alt=\"\" src=\"http://a.cksource.com/c/1/inc/img/demo-little-red.jpg\" />Little Red Riding Hood</h1>\r\n<p>&quot;<b>Little Red Riding Hood</b>&quot; is a famous<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Fairy_tale\" title=\"Fairy tale\">fairy tale</a><span class=\"Apple-converted-space\">&nbsp;</span>about a young girl&#39;s encounter with a wolf. The story has been changed considerably in its history and subject to numerous modern adaptations and readings.</p>\r\n<table align=\"right\" border=\"1\" cellpadding=\"1\" cellspacing=\"1\">\r\n	<caption>\r\n		<strong>International Names</strong></caption>\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n				Chinese</td>\r\n			<td>\r\n				<i>小紅帽</i></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				Italian</td>\r\n			<td>\r\n				<i>Cappuccetto Rosso</i></td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n				Spanish</td>\r\n			<td>\r\n				<i>Caperucita Roja</i></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>The version most widely known today is based on the<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Brothers_Grimm\" title=\"Brothers Grimm\">Brothers Grimm</a><span class=\"Apple-converted-space\">&nbsp;</span>variant. It is about a girl called Little Red Riding Hood, after the red<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Hood_%28headgear%29\" title=\"Hood (headgear)\">hooded</a><span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Cape\" title=\"Cape\">cape</a><span class=\"Apple-converted-space\">&nbsp;</span>or<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Cloak\" title=\"Cloak\">cloak</a><span class=\"Apple-converted-space\">&nbsp;</span>she wears. The girl walks through the woods to deliver food to her sick grandmother.</p>\r\n<p>A wolf wants to eat the girl but is afraid to do so in public. He approaches the girl, and she na&iuml;vely tells him where she is going. He suggests the girl pick some flowers, which she does. In the meantime, he goes to the grandmother&#39;s house and gains entry by pretending to be the girl. He swallows the grandmother whole, and waits for the girl, disguised as the grandmother.</p>\r\n<p>When the girl arrives, she notices he looks very strange to be her grandma. In most retellings, this eventually culminates with Little Red Riding Hood saying, &quot;My, what big teeth you have!&quot;<br />\r\n	To which the wolf replies, &quot;The better to eat you with,&quot; and swallows her whole, too.</p>\r\n<p>A<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Hunter\" title=\"Hunter\">hunter</a>, however, comes to the rescue and cuts the wolf open. Little Red Riding Hood and her grandmother emerge unharmed. They fill the wolf&#39;s body with heavy stones, which drown him when he falls into a well. Other versions of the story have had the grandmother shut in the closet instead of eaten, and some have Little Red Riding Hood saved by the hunter as the wolf advances on her rather than after she is eaten.</p>\r\n<p>The tale makes the clearest contrast between the safe world of the village and the dangers of the<span class=\"Apple-converted-space\">&nbsp;</span><a href=\"http://en.wikipedia.org/wiki/Enchanted_forest\" title=\"Enchanted forest\">forest</a>, conventional antitheses that are essentially medieval, though no written versions are as old as that.</p>\r\n', '', 'full_html');
INSERT INTO `field_data_body` VALUES ('node', 'article', '0', '2', '2', 'und', '0', '<p style=\"margin: 10px auto; padding: 0px; text-indent: 0px; word-wrap: break-word; color: rgb(51, 51, 51); font-family: SimSun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); \">　<strong>人民网重庆视窗8月14日电 胡虹、魏一东</strong>报道：今日上午，记者从重庆市公安局获悉，14日凌晨6时50分，在公安部统一指挥下，经过重庆等地公安机关连续数日艰苦奋战，犯下累累罪行的公安部A级通缉犯周克华在重庆沙坪坝区童家桥被公安民警成功击毙。至此，苏湘渝系列持枪抢劫杀人案件成功告破。</p>\r\n<p style=\"margin: 10px auto; padding: 0px; text-indent: 0px; word-wrap: break-word; color: rgb(51, 51, 51); font-family: SimSun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); \">　　8月10日9时34分，重庆市沙坪坝区凤鸣山康居苑中国银行储蓄所门前发生一起持枪抢劫杀人案，案犯打死1人、打伤2人后逃逸。经查，该案与2004年以来发生在江苏南京、湖南长沙、重庆等地的多起持枪抢劫杀人案系同一犯罪嫌疑人周克华所为。周克华，男，汉族，1970年2月6日出生，系重庆市沙坪坝区井口镇二塘村人。</p>\r\n<p style=\"margin: 10px auto; padding: 0px; text-indent: 0px; word-wrap: break-word; color: rgb(51, 51, 51); font-family: SimSun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); \">　　案发后，公安部和重庆市委、市政府高度重视，中共中央政治局委员、国务院副总理、重庆市委书记张德江，国务委员、公安部部长孟建柱先后作出重要批示，要求采取一切措施，尽快将犯罪嫌疑人缉拿归案。</p>\r\n<p style=\"margin: 10px auto; padding: 0px; text-indent: 0px; word-wrap: break-word; color: rgb(51, 51, 51); font-family: SimSun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); \">　　受国务委员、公安部部长孟建柱委派，公安部副部长张新枫专程赶赴重庆坐镇一线指挥，公安部第一时间向全国发出A级通缉令，并派出专家组指导案件侦破。重庆市公安局全警动员、全警参战，副市长、公安局长何挺指挥全市公安民警会同武警和驻渝部队官兵冒着40多度的高温酷暑开展严密封控、全力围捕等工作，发布缉捕通告，广泛发动人民群众提供线索。在公安部统一协调指挥下，全国公安机关同步开展案件协查工作，湖南、四川、贵州等相邻省份层层设卡布控，形成了一张围捕顽凶的天罗地网。经过连续4天昼夜奋战，于8月14日凌晨6时50分在重庆沙坪坝区覃家港镇童家桥村莴笋沟背后，我公安民警将其当场击毙。</p>\r\n<p style=\"margin: 10px auto; padding: 0px; text-indent: 0px; word-wrap: break-word; color: rgb(51, 51, 51); font-family: SimSun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); \">　　据悉，此前，长沙警方成功获取周克华体貌特征，江苏警方进一步确定他的DNA等重要信息，为案件的成功侦破奠定了坚实的基础。</p>\r\n<p style=\"margin: 10px auto; padding: 0px; text-indent: 0px; word-wrap: break-word; color: rgb(51, 51, 51); font-family: SimSun; font-size: 14px; font-style: normal; font-variant: normal; font-weight: normal; letter-spacing: normal; line-height: 26px; orphans: 2; text-align: start; text-transform: none; white-space: normal; widows: 2; word-spacing: 0px; -webkit-text-size-adjust: auto; -webkit-text-stroke-width: 0px; background-color: rgb(255, 255, 255); \">　　国务委员、公安部部长孟建柱在第一时间签署命令向重庆市公安局颁发嘉奖令，授予重庆市公安局集体一等功。</p>\r\n', '', 'filtered_html');
