INSERT INTO `search_dataset` VALUES ('1', 'node', '  关于我 于我们  little red riding hood   little red riding hood  is a famous  fairy tale  about a young girl s encounter with a wolf the story has been changed considerably in its history and subject to numerous modern adaptations and readings international names chinese  小紅帽  italian cappuccetto rosso spanish caperucita roja the version most widely known today is based on the  brothers grimm  variant it is about a girl called little red riding hood after the red  hooded   cape  or  cloak  she wears the girl walks through the woods to deliver food to her sick grandmother a wolf wants to eat the girl but is afraid to do so in public he approaches the girl and she naïvely tells him where she is going he suggests the girl pick some flowers which she does in the meantime he goes to the grandmother s house and gains entry by pretending to be the girl he swallows the grandmother whole and waits for the girl disguised as the grandmother when the girl arrives she notices he looks very strange to be her grandma in most retellings this eventually culminates with little red riding hood saying my what big teeth you have to which the wolf replies the better to eat you with and swallows her whole too a  hunter  however comes to the rescue and cuts the wolf open little red riding hood and her grandmother emerge unharmed they fill the wolf s body with heavy stones which drown him when he falls into a well other versions of the story have had the grandmother shut in the closet instead of eaten and some have little red riding hood saved by the hunter as the wolf advances on her rather than after she is eaten the tale makes the clearest contrast between the safe world of the village and the dangers of the  forest  conventional antitheses that are essentially medieval though no written versions are as old as that  关于我 于我们  ', '0');
